import './Card.css';

export default function Card(props) {

    let title;
    if (props.isChecked) {
        title = props.title;
    } else {
        title = props.title + '(*)';
    }

    return (
        <div
            className='card'
            style={{
                width: '150px',
                border: '1px solid black'
            }}
        >
            <div className={'cover'}></div>
            <div className={'card-body'}>
                <div>{props.post.date}</div>
                <div>{title}</div>
                <div>{props.post.desc}</div>
            </div>
            <div className={'card-footer'}>
                {props.post.writer}
            </div>
            <button onClick={props.modifyHandler}>modify</button>
        </div>
    );
}
